import { useParams } from "react-router-dom";
import co from "../MatematicaParaConcursos";
import "../../../../../styles/courses/math/planetsLayout.css";

function PlanetPage() {
  const { id } = useParams();
  const planet = planets.find(c => c.id === id);

  if(!planet){
    return <p>Curso não encontrado.</p>
  }

  return(
    <div className="HomePageGlobalDiv">
      <div className="NousNovaPlanetsLayout">
        {/* Cabeçalho */}
        <section id="title">
          <h1>{planet.name} |</h1>
          <h3>{planet.description}</h3>
        </section>
      </div>
    </div>
  )
}

export default PlanetPage;
